import React, { useState } from 'react';

const Student = () => {
  const [students, setStudents] = useState([]);
  const [newStudent, setNewStudent] = useState({
    id: '',
    name: '',
    major: '',
    year: '',
  });

  const addStudent = () => {
    if (newStudent.id && newStudent.name && newStudent.major && newStudent.year) {
      setStudents([...students, newStudent]);
      setNewStudent({ id: '', name: '', major: '', year: '' });
    } else {
      alert('Please enter full information');
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Student</h2>
      <div className="grid grid-cols-2 gap-4 mb-6">
        <input
          type="text"
          placeholder="Student ID"
          value={newStudent.id}
          onChange={(e) => setNewStudent({ ...newStudent, id: e.target.value })}
          className="p-2 border rounded"
        />
        <input
          type="text"
          placeholder="Full name"
          value={newStudent.name}
          onChange={(e) => setNewStudent({ ...newStudent, name: e.target.value })}
          className="p-2 border rounded"
        />
        <select
          value={newStudent.major}
          onChange={(e) => setNewStudent({ ...newStudent, major: e.target.value })}
          className="p-2 border rounded"
        >
          <option value="">Choose major</option>
          <option value="ICT">ICT - Information and Communication Technology</option>
          <option value="CS">CS - Cyber Security</option>
          <option value="DS">DS - Data Science</option>
        </select>
        <select
          value={newStudent.year}
          onChange={(e) => setNewStudent({ ...newStudent, year: e.target.value })}
          className="p-2 border rounded"
        >
          <option value="">Choose academic year</option>
          <option value="B0">B0</option>
          <option value="B1">B1</option>
          <option value="B2">B2</option>
          <option value="B3">B</option>
        </select>
        <button
          onClick={addStudent}
          className="col-span-2 bg-green-500 text-white p-2 rounded hover:bg-green-600"
        >
          Thêm sinh viên
        </button>
      </div>
      <table className="w-full border-collapse border">
        <thead>
          <tr className="bg-gray-200">
            <th className="border p-2">ID</th>
            <th className="border p-2">Họ tên</th>
            <th className="border p-2">Ngành học</th>
            <th className="border p-2">Năm học</th>
          </tr>
        </thead>
        <tbody>
          {students.map((student, index) => (
            <tr key={index}>
              <td className="border p-2">{student.id}</td>
              <td className="border p-2">{student.name}</td>
              <td className="border p-2">{student.major}</td>
              <td className="border p-2">{student.year}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Student;
